PREFIX wd: <http://www.wikidata.org/entity/>
PREFIX rdfs: <http://www.w3.org/2000/01/rdf-schema#>
PREFIX wdt: <http://www.wikidata.org/prop/direct/>
SELECT ?dog ?dogLabel ( ( ( YEAR( ?dod ) - YEAR( ?dob ) ) + ( ( MONTH( ?dod ) - MONTH( ?dob ) ) / 12 ) + ( ( DAY( ?dod ) - DAY( ?dob ) ) / 365 ) ) AS ?lifespanYears ) WHERE {
  ?dog wdt:P31 wd:Q144 ; wdt:P569 ?dob ; wdt:P570 ?dod .
  OPTIONAL {
    ?dog rdfs:label ?dogLabel FILTER ( LANG( ?dogLabel ) = "en" )
  }
}
ORDER BY DESC ( ?lifespanYears )
OFFSET 1
LIMIT 1

PREFIX wd: <http://www.wikidata.org/entity/>
