SELECT ( COUNT( DISTINCT ?mountain ) AS ?count ) ( GROUP_CONCAT( DISTINCT ?mountainLabel ; separator = ", " ) AS ?mountains ) WHERE {
  {
    SELECT DISTINCT ?mountain ?mountainLabel WHERE {
      ?mountain wdt:P31 / wdt:P279 * wd:Q8502 .
      OPTIONAL {
        ?mountain rdfs:label ?mountainLabel FILTER ( LANG( ?mountainLabel ) = "en" )
      }
      {
        ?mountain wdt:P131 / wdt:P361 * wd:Q183 .
      } UNION {
        ?mountain wdt:P3842 / wdt:P361 * wd:Q183 .
      } UNION {
        ?mountain wdt:P17 wd:Q183 .
      }
    }
  }
}

