PREFIX ps: <http://www.wikidata.org/prop/statement/>
PREFIX xsd: <http://www.w3.org/2001/XMLSchema#>
PREFIX p: <http://www.wikidata.org/prop/>
PREFIX wd: <http://www.wikidata.org/entity/>
PREFIX pq: <http://www.wikidata.org/prop/qualifier/>
ASK WHERE {
  wd:Q169452 p:P54 ?statement1 .
  ?statement1 ps:P54 wd:Q121783 .
  OPTIONAL {
    ?statement1 pq:P580 ?start1 .
  }
  OPTIONAL {
    ?statement1 pq:P582 ?end1 .
  }
  wd:Q25369 p:P54 ?statement2 .
  ?statement2 ps:P54 wd:Q121783 .
  OPTIONAL {
    ?statement2 pq:P580 ?start2 .
  }
  OPTIONAL {
    ?statement2 pq:P582 ?end2 .
  }
  BIND( IF( BOUND( ?start1 ) , ?start1 , "1900-01-01T00:00:00Z" ^^ xsd:dateTime ) AS ?s1 ) BIND( IF( BOUND( ?end1 ) , ?end1 , "2100-01-01T00:00:00Z" ^^ xsd:dateTime ) AS ?e1 ) BIND( IF( BOUND( ?start2 ) , ?start2 , "1900-01-01T00:00:00Z" ^^ xsd:dateTime ) AS ?s2 ) BIND( IF( BOUND( ?end2 ) , ?end2 , "2100-01-01T00:00:00Z" ^^ xsd:dateTime ) AS ?e2 ) FILTER ( ?e1 >= "2000-01-01T00:00:00Z" ^^ xsd:dateTime && ?s1 <= "2000-12-31T23:59:59Z" ^^ xsd:dateTime ) FILTER ( ?e2 >= "2000-01-01T00:00:00Z" ^^ xsd:dateTime && ?s2 <= "2000-12-31T23:59:59Z" ^^ xsd:dateTime ) FILTER ( ?s1 <= ?e2 && ?s2 <= ?e1 )
}

